# Tensorflow Object Detection Detector
import cv2
import face_recognition
import json
import numpy as np
#import tensorflow-human-detection 


class MatchingFaces:
    def facesCompare(markFoundPrint,markMiassingPrint):
#        face_locations = face_recognition.face_locations(img)
#        face_encodings = face_recognition.face_encodings(img, face_locations) 
#       print(json.dumps(tuple(zip(face_locations, face_encodings))))
        markMiassingPrint_npArray=[]
        for key , values in markMiassingPrint.items():
                markMiassingPrint_npArray.append(np.array(values.get('print')))
         
#        print(markMiassingPrint_np)
        output=[]
        npArrayOfFound=[]
        for fkey , value in markFoundPrint.items():
#            print(key)
            npArrayOfFound.append(np.array(value.get('print')))
#            print(npArrayOfFound)
            faceDistances=face_recognition.face_distance(markMiassingPrint_npArray,npArrayOfFound[0])
#            print(faceDistances)
            i=0
            for key , values in markMiassingPrint.items():
                 output.append({
                         "foundID":fkey,
                         "missingID":key,
                         "distance":faceDistances[i]
                         })
                 i+=1
            npArrayOfFound.clear()
        
        return json.loads(json.dumps(output))   
        
    
            

    
